pr396:
- create CL:9999999 'pyramidal family morphology'
- add definition 'A cell morphology that inheres in neurons which have a pyramidal
  shaped soma, a single axon, a large apical dendrite and multiple basal dendrites.'
  to CL:9999999
- create edge CL:9999999 rdfs:subClassOf CL:0000000
- create edge CL:9999999 oboInOwl:hasDbXref SAO:1465673360
- create edge CL:9999999 oboInOwl:hasDbXref ILX:0109553
pr396:
- create PLACEHOLDER:tufted_pyramidal_morphology 'tufted pyramidal morphology'
- add definition 'A pyramidal cell morphology that inheres in neurons which have a
  distinct tuft formation, distal from the soma.' to PLACEHOLDER:tufted_pyramidal_morphology
- create edge PLACEHOLDER:tufted_pyramidal_morphology rdfs:subClassOf PLACEHOLDER:pyramidal_morphology
- create synonym 'TuftedPyramidalPhenotype' for PLACEHOLDER:tufted_pyramidal_morphology
pr396:
- create CL:9000001 'untufted pyramidal morphology'
- add definition 'A pyramidal cell morphology that inheres in neurons which lack a
  clear tuft formation but extend to large radial distances.' to CL:9000001
- create edge CL:9000001 rdfs:subClassOf CL:0000598
- create exact synonym 'Neocortex Untufted Pyramidal Cell' for CL:9000001
- add CL:9000001 to subset ilxtr:UntuftedPyramidalPhenotype
pr396:
- create UBERON:0000955 'stellate pyramidal morphology'
- add definition 'A pyramidal cell morphology that inheres in neurons which lack a
  tuft formation but extend to small radial distances forming a star-like shape.'
  to UBERON:0000955
- create edge UBERON:0000955 rdfs:subClassOf PLACEHOLDER:pyramidal_morphology
- create exact synonym 'StarPyramidalPhenotype' for UBERON:0000955
pr396:
- create TEMP:0000001 'inverted pyramidal morphology'
- add definition 'A pyramidal cell morphology that inheres in neurons which have an
  apical tree which is oriented towards the white matter.' to TEMP:0000001
- create edge TEMP:0000001 rdfs:subClassOf TEMP:PYRAMIDAL_MORPHOLOGY
- add TEMP:0000001 to subset ilxtr:InvertedPyramidalPhenotype
pr396:
- create CL:9000001 'horizontal pyramidal morphology'
- add definition 'A pyramidal cell morphology that inheres in neurons which have an
  apical tree which is oriented parallel to the pia.' to CL:9000001
- create edge CL:9000001 rdfs:subClassOf CL:0000598
pr396:
- create node TEMP:001 'standard pyramidal morphology'
- create synonym 'vertical pyramidal morphology' for TEMP:001
- create synonym 'pyramidal morphology' for TEMP:001
- add definition 'A pyramidal cell morphology that inheres in neurons which have a
  standard pyramidal shape with its apical dendrite aligned vertically.' to TEMP:001
- create edge TEMP:001 rdfs:subClassOf TEMP:002
- create edge TEMP:001 owl:disjointWith TEMP:003
